import React from "react";

const Necas = ({ text }) => {
  console.log(text);
  return (
    <div className="Firo">
      <p>{text.Search[0].Title}</p>
    </div>
  );
};

Necas.defaultProps = {
  text: ["Sharknado"],
};

export default Necas;
